import React from 'react';
import '../styles/main.scss'

const Header = () => {
    return (
        <>
        <div className="header">
        <ul className="header__list">
        <li className="header__link">Home</li>
        <li className="header__link">Create</li>
        </ul>
        </div>
        </>
    );
}

export default Header;
